DECLARE
type tyExecutableEquivalence IS table of sa_executable.executable_id%type index BY sa_executable.name%type;
tbExecutableEquivalence tyExecutableEquivalence;
nuNewExecutableId sa_executable.executable_id%type;
nuIndex binary_integer;
nuRecCount binary_integer;
FUNCTION fnuGetNewExecutableId(isbExecutableName in sa_executable.name%type)
 return sa_executable.executable_id%type
IS
nuIndexInternal binary_integer;
BEGIN
 IF (tbExecutableEquivalence.exists(isbExecutableName)) THEN
  return tbExecutableEquivalence(isbExecutableName);
 END IF;
 tbExecutableEquivalence(isbExecutableName) := null;
 nuIndexInternal := SINCECOMP_VALORECLA_.tb2_0.first;
 while nuIndexInternal IS NOT null loop
  IF (SINCECOMP_VALORECLA_.tb2_0(nuIndexInternal)=isbExecutableName ) THEN
   IF (SINCECOMP_VALORECLA_.tb2_1.exists(nuIndexInternal)) then
    tbExecutableEquivalence(isbExecutableName) := SINCECOMP_VALORECLA_.tb2_1(nuIndexInternal);
   END IF;
   exit;
  END IF;
  nuIndexInternal := SINCECOMP_VALORECLA_.tb2_0.next(nuIndexInternal);
 END loop; 
 return tbExecutableEquivalence(isbExecutableName);
END;
BEGIN

if (not SINCECOMP_VALORECLA_.blProcessStatus) then
 return;
end if;
nuIndex :=  SINCECOMP_VALORECLA_.tbRoleExecutables.first;
while nuIndex IS NOT null loop
 if (SINCECOMP_VALORECLA_.tbRoleExecutables(nuIndex).role_id!=1) then
  nuNewExecutableId := fnuGetNewExecutableId(SINCECOMP_VALORECLA_.tbRoleExecutables(nuIndex).name);
  IF nuNewExecutableId is not null then
    INSERT INTO sa_role_executables (role_id, executable_id)
    VALUES (SINCECOMP_VALORECLA_.tbRoleExecutables(nuIndex).role_id, nuNewExecutableId);
  END IF;
  end if;
 nuIndex := SINCECOMP_VALORECLA_.tbRoleExecutables.next(nuIndex);
END loop;
nuIndex :=  SINCECOMP_VALORECLA_.tbUserException.first;
while nuIndex IS NOT null loop
 nuNewExecutableId := fnuGetNewExecutableId(SINCECOMP_VALORECLA_.tbUserException(nuIndex).name);
 IF nuNewExecutableId is not null then
  insert INTO sa_user_exceptions (executable_id, user_id, status, usr_exc_type_id, comment_)
  VALUES (nuNewExecutableId ,SINCECOMP_VALORECLA_.tbUserException(nuIndex).user_id, SINCECOMP_VALORECLA_.tbUserException(nuIndex).status , SINCECOMP_VALORECLA_.tbUserException(nuIndex).usr_exc_type_id, SINCECOMP_VALORECLA_.tbUserException(nuIndex).comment_);
 END IF;
 nuIndex := SINCECOMP_VALORECLA_.tbUserException.next(nuIndex);
END loop;
nuIndex :=  SINCECOMP_VALORECLA_.tbExecEntities.first;
while nuIndex IS NOT null loop
 nuNewExecutableId := fnuGetNewExecutableId(SINCECOMP_VALORECLA_.tbExecEntities(nuIndex).name);
 IF nuNewExecutableId is not null then
  select count(1) into nuRecCount
 from sa_exec_entities
  where executable_id = nuNewExecutableId and entity_id = SINCECOMP_VALORECLA_.tbExecEntities(nuIndex).entity_id;
  IF nuRecCount = 0 then
    insert INTO sa_exec_entities (executable_id, entity_id )
    VALUES (nuNewExecutableId ,SINCECOMP_VALORECLA_.tbExecEntities(nuIndex).entity_id );
  END IF;
 END IF;
 nuIndex := SINCECOMP_VALORECLA_.tbExecEntities.next(nuIndex);
END loop;

exception when others then
SINCECOMP_VALORECLA_.blProcessStatus := false;
rollback;
ut_trace.trace('**ERROR:'||sqlerrm);
raise;
END;
